// roles.js
import React, { useEffect, useState } from 'react';
import transactionService from '../../services/transactionService';
import { useUser } from '../../context/userProvider';

import { Link, useNavigate } from 'react-router-dom';
import roleService from '../../services/roleService';

const RoleManager = () => {
    const navigate = useNavigate();

    const [page, setPage] = useState(1);
    const { user } = useUser();
    const [roles, setRoles] = useState();
    useEffect(() => {
        const fetchData = async () => {
            try {
                const data = await roleService.getAllByPage({ page: page, size: 5 });
                console.log(data);
                setRoles(data);
            } catch (error) {
                console.error('Error fetching products:', error);
            }
        };

        fetchData();
    }, [page]);


    const handleClick = (role) => {
        navigate('/dashboard/role-details', { state: { role } });
    }
    return (
        <div class="container">
            <div className='bg-gray-500'>
                {/* TÌM KIẾM    */}
                <div>
                    
                </div>
            </div>
            <div class="header">
                <h1 class="title">All Products</h1>
            </div>
            <table class="table">
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Type</th>
                        <th>Quantity</th>
                        <th>Daily Sales</th>
                        <th>Monthly Sales</th>
                        <th>Rating</th>
                        <th>Total Sales</th>
                        <th>Total Revenue</th>
                        <th>Updated Date</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>Product 1tạo </td>
                        <td>Product Type 1</td>
                        <td>100</td>
                        <td>1000</td>
                        <td>10000</td>
                        <td>5</td>
                        <td>5000</td>
                        <td>50000</td>
                        <td>2023-11-30</td>

                    </tr>
                    <tr>
                        <td>Product 2</td>
                        <td>Product Type 2</td>
                        <td>200</td>
                        <td>2000</td>
                        <td>20000</td>
                        <td>4</td>
                        <td>8000</td>
                        <td>80000</td>
                        <td>2023-11-29</td>
                    </tr>
                    <tr>
                        <td>Product 3</td>
                        <td>Product Type 3</td>
                        <td>300</td>
                        <td>3000</td>
                        <td>30000</td>
                        <td>3</td>
                        <td>9000</td>
                        <td>90000</td>
                        <td>2023-11-28</td>
                    </tr>
                </tbody>
            </table>
            <div class="buttons">
                <button class="button">Search Product</button>
                <button class="button">Add Product</button>
                <button class="button">Filter</button>
            </div>
        </div>

    );
};

export default RoleManager;
